import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <div> Course Booking App</div>
            <ul>
                <Link to ="/">
                    <li>Home</li>
                </Link>

                <li>Create Course</li>
                <li>Enroll</li>
            </ul>
        </nav>
    )
}

export default Navbar
